s.m(0,"charging_kisok",new A.e_("Asimov's E-charging station\n\nCharge your electric vehicles here!\n(We accept robot vacuum charging too).\n\nElectric vehicles have a smaller carbon footprint than gasoline cars.\nEVs will create fewer carbon emissions than gasoline-burning cars.\nMake the switch today!\n\nSources: https://www.epa.gov/greenvehicles/electric-vehicle-myths,\nhttps://climate.mit.edu/ask-mit/are-electric -vehicles-definitely-better-climate-gas-powered-cars"))
s.m(0,"garden",new A.e_("Gomiland Community garden\n\nPlants here are grown with sunlight, love and of course, organic fertilizers.\nOur crops grown here are served at cafes around the town.\nCommunity gardens reduce transport costs of ingredients and promotes sustainable living\nGet involved today by collecting food scraps to make compost!\n\nFounded by Mr Moon and Mr Sun.\n"))
s.m(0,"cafe",new A.e_("Enjoyeux cafe\n\nBest vegan food in town!\n\nChoosing plant-based proteins like beans, lentils, and tofu shrinks your carbon footprint.\n\nIt conserves precious water and protects biodiversity.\n\nGo green, go meatless, and savor the positive impact on our planet, one delicious bite at a time\n\nGreenhouse Gases: Animal agriculture is responsible for 14.5% of global greenhouse gas emissions\nLivestock production uses 70% of all agricultural land globally, yet only provides 18% of the world's calories. Choosing plant-based foods frees up land for other uses, like restoring natural ecosystems\n\nSource: https://www.reuters.com/business/environment/ factbox-how-food-agriculture-contribute-climate-change-2023-12-02/"))
s.m(0,"friendship_square",new A.e_("Friendship Square\n\nMeet your friends from around the world here.\n\nLearn interesting facts, receive wonderful gifts and much more.\nTalk to everyone!"))
s.m(0,"park_sign",new A.e_("This way to Gomiland National Park.\n\nDon't forget to visit the Castle, Bamboo Forest Shrine, World forest and the Honey Bee Colony\n\nPlease pick up rubbish in the park. Let's do our part to keep the park clean!\n\nImportance of National Parks:\n1. Protect ecological biodiversity, preserve landscapes\n2. Provide economic support for natural and cultural resources through tourism\n3. Protection from threats including logging and land clearing, pollution, and urban development\n4. Provide a safe haven for threatened native species\n\nSource: https://blog.nationalparks.nsw.gov.au/whats-a-national-park-and-why-does-it-matter,\nhttps://www.nathab.com/blog/why-national-parks-matter,"))
s.m(0,"school",new A.e_("Gomiland Elementary School\n\nWhere young minds flourish"))
s.m(0,"zen_garden",new A.e_("Zen garden\n\nStay and enjoy the tranquility of the garden"))
s.m(0,"shrine_complex",new A.e_("Bamboo forest shrine\n\nWelcome traveller to the shrine.\nDue to a paper shortage, we are unable to provide books, charms or talismans.\nWe seek your understanding for this matter."))
s.m(0,"bamboo_forest",new A.e_("Bamboo forest\n\nBamboo requires less water than most trees\nThey prevent soil erosion, maintain soil fertility, and promote healthy watersheds\n"))
s.m(0,"hood_sign",new A.e_("Gomiland Neighbourhood\nBustling energy meets friendly charm\n\nGomiland achieves sustainability through:\n1. Green public spaces\n2. Water and energy conservation\n3. Walking and bike friendly roads\n4. Eco-friendly buildings\n5. Waste management system (new)"))
s.m(0,"park_centre",new A.e_("Gomiland National Park\nHome to many different species of plants and wildlife.\n\nImportance of National Parks:\n1. Protect ecological biodiversity, preserve landscapes\n2. Provide economic support for natural and cultural resources through tourism\n"))
s.m(0,"castle",new A.e_("Gomiland castle\n\n\nPlease do not throw trash on the castle grounds."))
s.m(0,"sakuras",new A.e_("Cherry Blossoms\n\nDue to climate change, Cherry Blossom blooms are happening earlier each year.\nThis puts them at risk of cold snaps.\n\nBecause of warming climate, flowers may bloom before insects are ready and vice versa.\nThis means there may not be enough food for the insects or plants.\n\nLet's do our part to protect the environment today!\n\nSource: https://www.washingtonpost.com/weather/2023/03/18/ cherry-blossoms-climate-change-washington,\nhttps://edition.cnn.com/travel/article/ climate-crisis-cherry-blossom-kyoto-japan-intl-hnk-scn"))
s.m(0,"bee_colony",new A.e_("Honey Bee colony\n\nBest honey in Gomiland! Look for Manuka to find out how to get your honey!\n\nHoney bees perform majority of pollination for our food crops\nHowever their global population is in decline which is a threat to our food security\nImage a world where you can't get tasty honey!\nFound out how you can do your part to save the bees at https://thebeeconservancy.org/10-ways-to-save-the-bees/\n\nSource: https://e360.yale.edu/features/ declining_bee_populations_pose_a_threat_to_global_agriculture,\nhttps://www.clemson.edu/extension/ pollinators/apiculture/importance.html"))
s.m(0,"world_forest",new A.e_("World forest\n\nCheck out trees from all over the world!\n\nImportant habitats like forests and jungles are being cleared at an unsustainable rate globally\nWe must do our part to conserve these essential wild spaces for future generations\n\nBe a tree advocate:\nSupport organizations working to conserve forests and advocate for policies that protect these vital ecosystems.\nSpeak up for our trees!\n\nFind out about deforestation at https://ourworldindata.org/deforestation"))
s.m(0,"statue",new A.e_("Statue under restoration\n\n\nWe apologise for the inconvenience\n\nHelping others could speed up restoration efforts..."))
s.m(0,"warrior",new A.e_("Statue of brave eco-warrior\n\n\nProvider of aid to those in need,\nprotector of our ecosystems\nguardian of our natural habitat.\n\nThanks for contributing to sustainability player!"))
s.m(0,"how_to_sort",new A.e_("Sorting instructions:\n\n1. Drag and drop the rubbish on the table into the bins\n2. The bins correspond to a recyclable material type:\nPlastic, Paper, Glass, Metal, Food waste and Electronic waste3. Get G-coins from the city council for getting it right.4. Get fined if you get it wrong."))
s.m(0,"combini",new A.e_("Go 24hr convenience store\n\nGet the best deals in town"))
